const Filter = (props) => {
    return ( 
        <div className="col-lg-2">
            <ul className="list-group">
                {
                    items.map(item => {
                        return (
                            <>
                                <li className="list-group-item">
                                {item}
                                </li>
                            </>
                        )
                    })
                }
            </ul>
        </div>
    );
}
 
export default Filter;
